import React from "react";
import Select from "react-dropdown-select";
import options from "../media/options"

function Origen() {
    return (
        <Select options={options} onChange={(value) => console.log(`%c > onChange ${Origen} `,
         'background: #000; color: tomato', value)} />
    )
}


export default Origen;
